डॉक्टर अपॉइंटमेंट्स स्लॉट माहिती अपॉइंटमेंट बुक केली आहे मिनिटे बुक केले रद्द केले कृपया भेटीची बुकिंग करण्यापूर्वी प्रथम भेट अपलोड करा. नियोजित भेट यशस्वीरित्या बुक झाली! अपॉइंटमेंट बुक करण्यात अयशस्वी! कृपया वैध पोस्टल कोड प्रविष्ट करा अपॉइंटमेंट रद्द करण्यात अयशस्वी! अपॉइंटमेंट यशस्वीरित्या रद्द करण्यात आली!
पुस्तक भेट अपॉइंटमेंट पुन्हा शेड्यूल करा तुम्ही हा स्लॉट बुक करणार आहात का? तुम्हाला भेट रद्द करण्याची खात्री आहे का? अपॉइंटमेंट रद्द करा निवडलेल्या तारखेसाठी आणि विशेषतेसाठी अपॉइंटमेंट स्लॉट उपलब्ध नाही! तुमच्याकडे कोणतीही भेट नाही! अपॉइंटमेंट सूची अपॉइंटमेंट बुकिंग साठी भेट कृपया अपॉइंटमेंट स्लॉट निवडा कृपया स्पेशॅलिटी निवडा! कृपया तुमचे रीशेड्यूल कारण निवडा कृपया तुमचे रद्द करण्याचे कारण निवडा डॉक्टर उपलब्ध नाहीत पेशंट उपलब्ध नाही इतर कृपया कारण तपशील प्रविष्ट करा कृपया कारण प्रविष्ट करा!
निदान प्राथमिक दुय्यम तात्पुरती पुष्टी केली शिफारस केलेले औषध औषध शक्ती युनिट्स (उदा: mg) युनिट्स (उदा: टॅब/सिरप) कालावधीसाठी युनिट्स (उदा. दिवस/आठवडे/इ.) अतिरिक्त सूचना शिफारस केलेल्या चाचण्या चाचणी पेशंटला सल्ला किंवा संदर्भ द्या नोट्स टिपा (रुग्णासोबत शेअर केलेल्या नाहीत) फॉलो अप स्वाक्षरी करा आणि सबमिट करा चाचणी जोडा सल्ला जोडा टीप जोडा एक फॉलो अप शेड्यूल करा सबमिट करा औषध जोडा निदान जोडा प्रारंभ भेट टीप धन्यवाद! प्रिस्क्रिप्शन यशस्वीरित्या दिले आहे कृपया एका वेळी फक्त एक फॉलोअप प्रदान करा. रक्कम वारंवारता मार्ग (पर्यायी) कारण (पर्यायी) तारीख निवडा फॉलो अप टिप्पणी कृपया प्रिस्क्रिप्शन देण्याचा प्रयत्न करण्यापूर्वी प्रथम अपलोड करा. प्रिस्क्रिप्शन आधीच दिलेले आहे. कृपया प्रिस्क्रिप्शन डाउनलोड करा.
